      $('input[name^="variants_1"]').on('click', function(e) {
        if (form.find('input[name^="variants_1"]:checked').length > 3) {
          $(e.target).attr('checked', false);
          return false;
        }
      });
      $('input[name^="variants_2"]').on('click', function(e) {
        if (form.find('input[name^="variants_2"]:checked').length > 3) {
          $(e.target).attr('checked', false);
          return false;
        }
      });
